import React from 'react';
import SectionHeader from './SectionHeader';
import { Container, Jumbotron } from 'react-bootstrap';
import styled from 'styled-components';

const Styles = styled.div`

background: #d65a31;

.address {
  text-align: center;
}
`

function Contact() {
  return (
    <Styles id="contact">
      <SectionHeader name="Contact" />
      <div className="address">
        <h1>Barber Andrew</h1>
        <h1>Orzechowa 50</h1>
        <h1>50-540 Wrocław</h1>
      </div>
      <div class="address">
        <h1>Opening Times:</h1>
        <h1>Monday – Friday: 9.00am – 5.30pm</h1>
        <h1>Saturday: 8.30am – 5.00pm</h1>
        <h1>Sunday: Closed</h1>
      </div>
    </Styles>
  );



}

export default Contact;
